import React from 'react';
import { useNavigate } from 'react-router-dom';
import './CardEspecialidade.css';

function CardEspecialidade({ especialidade }) {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate(`/agendamento/${especialidade}`);
  };

  return (
    <div
      className="card card-especialidade text-center shadow-sm"
      onClick={handleClick}
    >
      <h5>{especialidade}</h5>
      <p>Agende sua consulta</p>
    </div>
  );
}

export default CardEspecialidade;
